ource entries.'=>'Alle gelokaliseerde bronvermeldingen opgeschoond.','<b>Last crawled:</b> %d item(s)'=>'<b>Laatst gecrawld:</b> %d item(s)','View .htaccess'=>'Bekijk .htaccess','You can use this code %1$s in %2$s to specify the htaccess file path.'=>'Je kunt deze code %1$s gebruiken in %2$s om het htaccess bestandspad aan te geven.','PHP Constant %s is supported.'=>'PHP Constant %s wordt ondersteund.','Default path is'=>'Standaard pad is','.htaccess Path'=>'.htaccess pad','Please read all warnings before enabling this option.'=>'Lees alle waarschuwingen voordat je deze optie inschakelt.','This will delete all generated unique CSS files'=>'Dit zal alle gegenereerde unieke CSS bestanden verwijderen','In order to avoid an upgrade error, you must be using %1$s or later before you can upgrade to %2$s versions.'=>'Om fouten bij een upgrade te voorkomen, moet je %1$s of hoger gebruiken voordat je kunt upgraden naar %2$s versies.','Use latest GitHub Dev/Master commit'=>'Laatste GitHub dev/master commit gebruiken','Press the %s button to use the most recent GitHub commit. Master is for release candidate & Dev is for experimental testing.'=>'Druk op de %s knop om de meest recente GitHub commit te gebruiken. Master is voor release kandidaat & Dev is voor experimenteel testen.','Downgrade not recommended. May cause fatal error due to refactored code.'=>'Downgraden wordt niet aanbevolen. Kan fatale fout veroorzaken door geüpdatete code.','Only optimize pages for guest (not logged in) visitors. If turned this OFF, CSS/JS/CCSS files will be doubled by each user group.'=>'Optimaliseer alleen pagina\'s voor gast (niet ingelogde) bezoekers. Als dit UIT staat, worden CSS/JS/CCSS bestanden verdubbeld voor elke gebruikersgroep.','Listed JS files or inline JS code will not be optimized by %s.'=>'Opgesomde JS bestanden of inline JS code worden door %s niet geoptimaliseerd.','Listed URI will not generate UCSS.'=>'In de lijst opgenomen URI zal geen UCSS genereren.','The selector must exist