ct\' voor Google Fonts toe om eerder een verbinding te maken.','Delay rendering off-screen HTML elements by its selector.'=>'Vertraag het renderen van buiten-het-scherm HTML elementen door zijn selector.','Disable this option to generate CCSS per Post Type instead of per page. This can save significant CCSS quota, however it may result in incorrect CSS styling if your site uses a page builder.'=>'Schakel deze optie uit om CCSS per berichttype te genereren in plaats van per pagina. Dit kan aanzienlijke CCSS quota\'s besparen, maar het kan resulteren in onjuiste CSS styling als je site een pagina bouwer gebruikt.','This option is bypassed due to %s option.'=>'Deze optie wordt omzeild door de optie %s.','Elements with attribute %s in HTML code will be excluded.'=>'Elementen in de HTML code met attribuut %s worden uitgesloten.','Use QUIC.cloud online service to generate critical CSS and load remaining CSS asynchronously.'=>'Online service QUIC.cloud gebruiken om kritieke CSS te genereren en overige CSS asynchroon te laden.','This option will automatically bypass %s option.'=>'Deze optie omzeilt automatisch de optie %s.','Inline UCSS to reduce the extra CSS file loading. This option will not be automatically turned on for %1$s pages. To use it on %1$s pages, please set it to ON.'=>'Inline UCSS om het extra laden van CSS bestanden te verminderen. Deze optie wordt niet automatisch ingeschakeld voor %1$s pagina\'s. Om het op %1$s pagina\'s te gebruiken, zet je het op ON.','Run %s Queue Manually'=>'Voer %s wachtrij handmatig uit','This option is bypassed because %1$s option is %2$s.'=>'Deze optie wordt omzeild omdat %1$s optie is %2$s.','Automatic generation of unique CSS is in the background via a cron-based queue.'=>'Het automatisch genereren van unieke CSS gebeurt in de achtergrond via een cron-gebaseerde wachtrij.','This will drop the unused CSS on each page from the combined file.'=>'Hierdoor wordt de ongebruikte CSS op elke pagina uit het gecombineerde bestand verwijde